import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom';
import { FaUser, FaShoppingCart, FaSignInAlt, FaSearch } from 'react-icons/fa';
import { useState } from 'react';

import Home from './Home';
import CartPage from './CartPage';
import CheckoutPage from './CheckoutPage';
import OrderHistoryPage from './OrderHistoryPage';
import LoginPage from './LoginPage';
import RegisterPage from './RegisterPage';
import ProfilePage from './ProfilePage';
import AdminPage from './AdminPage';

export default function App() {
  const [search, setSearch] = useState('');
  const [cartItems, setCartItems] = useState([]);
  const [orders, setOrders] = useState([]);

  const featuredBooks = [
    { id: 1, title: 'Clean Code', author: 'Robert C. Martin', genre: 'Programming', price: 30 },
    { id: 2, title: 'The Pragmatic Programmer', author: 'Andrew Hunt', genre: 'Programming', price: 35 },
    { id: 3, title: 'Refactoring', author: 'Martin Fowler', genre: 'Programming', price: 40 },
    { id: 4, title: 'You Donâ€™t Know JS', author: 'Kyle Simpson', genre: 'JavaScript', price: 25 },
    { id: 5, title: 'Deep Work', author: 'Cal Newport', genre: 'Productivity', price: 20 },
    { id: 6, title: 'Design Patterns', author: 'Erich Gamma', genre: 'Software Engineering', price: 50 },
    { id: 7, title: 'Effective Java', author: 'Joshua Bloch', genre: 'Programming', price: 45 },
    { id: 8, title: 'Atomic Habits', author: 'James Clear', genre: 'Self-Help', price: 18 },
    { id: 9, title: 'Grokking Algorithms', author: 'Aditya Bhargava', genre: 'Algorithms', price: 28 },
    { id: 10, title: 'Introduction to Algorithms', author: 'Thomas H. Cormen', genre: 'Algorithms', price: 65 },
  ];

  const comingSoonBooks = [
    { id: 11, title: 'AI for Everyone', author: 'Andrew Ng', genre: 'Technology', price: 40 },
    { id: 12, title: 'Next.js in Action', author: 'Vercel Team', genre: 'Web Development', price: 45 },
    { id: 13, title: 'Rust Programming', author: 'Steve Klabnik', genre: 'Programming', price: 38 },
    { id: 14, title: 'System Design Interview', author: 'Alex Xu', genre: 'Interviews', price: 42 },
    { id: 15, title: 'Clean Architecture', author: 'Robert C. Martin', genre: 'Software Engineering', price: 35 },
    { id: 16, title: 'TypeScript Handbook', author: 'Daniel Rosenwasser', genre: 'Programming', price: 30 },
    { id: 17, title: 'Machine Learning Yearning', author: 'Andrew Ng', genre: 'AI', price: 33 },
    { id: 18, title: 'The Art of Computer Programming', author: 'Donald Knuth', genre: 'Computer Science', price: 90 },
    { id: 19, title: 'Kubernetes Up & Running', author: 'Kelsey Hightower', genre: 'DevOps', price: 48 },
    { id: 20, title: 'Python Crash Course', author: 'Eric Matthes', genre: 'Programming', price: 27 },
  ];

  const handleAddToCart = (book) => {
    setCartItems(prev => {
      const existing = prev.find(item => item.id === book.id);
      if (existing) {
        return prev.map(item => item.id === book.id ? { ...item, quantity: item.quantity + 1 } : item);
      } else {
        return [...prev, { ...book, quantity: 1 }];
      }
    });
  };

  const handleQuantityChange = (id, delta) => {
    setCartItems(prev =>
      prev
        .map(item => item.id === id ? { ...item, quantity: item.quantity + delta } : item)
        .filter(item => item.quantity > 0)
    );
  };

  return (
    <Router>
      <div style={{ fontFamily: 'Arial, sans-serif', padding: '20px' }}>
        <header style={{ background: '#4a90e2', color: 'white', padding: '15px', borderRadius: '8px', marginBottom: '20px' }}>
          <Link to="/" style={{ color: 'white', textDecoration: 'none' }}>
            <h1>ðŸ“š Online Bookstore System</h1>
          </Link>
          <div style={{ display: 'flex', gap: '10px', flexWrap: 'wrap', alignItems: 'center' }}>
            <Link style={navStyle} to="/login"><FaSignInAlt /> Login</Link>
            <Link style={navStyle} to="/register">Register</Link>
            <Link style={navStyle} to="/profile"><FaUser /> Profile</Link>
            <Link style={navStyle} to="/order-history">Order History</Link>
            <Link style={navStyle} to="/admin">Admin</Link>
            <Link style={navStyle} to="/cart"><FaShoppingCart /> Cart ({cartItems.reduce((sum, item) => sum + item.quantity, 0)})</Link>
            <div style={{ display: 'flex', background: 'white', borderRadius: '5px', padding: '5px 10px', alignItems: 'center' }}>
              <FaSearch color="#4a90e2" />
              <input
                type="text"
                value={search}
                onChange={(e) => setSearch(e.target.value)}
                placeholder="Search books..."
                style={{ border: 'none', outline: 'none', marginLeft: '5px' }}
              />
            </div>
          </div>
        </header>

        <Routes>
          <Route path="/" element={<Home featuredBooks={featuredBooks} comingSoonBooks={comingSoonBooks} handleAddToCart={handleAddToCart} />} />
          <Route path="/cart" element={<CartPage cartItems={cartItems} handleQuantityChange={handleQuantityChange} />} />
          <Route path="/checkout" element={<CheckoutPage cartItems={cartItems} setCartItems={setCartItems} setOrders={setOrders} />} />
          <Route path="/order-history" element={<OrderHistoryPage orders={orders} setCartItems={setCartItems} />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/register" element={<RegisterPage />} />
          <Route path="/profile" element={<ProfilePage />} />
          <Route path="/admin" element={<AdminPage />} />
        </Routes>
      </div>
    </Router>
  );
}

const navStyle = {
  background: '#fff',
  padding: '5px 10px',
  borderRadius: '5px',
  textDecoration: 'none',
  color: '#4a90e2',
  fontWeight: 'bold',
  display: 'flex',
  alignItems: 'center',
  gap: '5px'
};
